import React, { Component } from 'react';

class JugadoresPagina extends Component {
    constructor(props) {
        super(props);
        this.state = {
            jugador: []
        };
    }

    componentDidMount() {
        fetch('/api/jugadores')
            .then(res => res.json())
            .then(jugador => this.setState({jugador}, () => console.log('Jugadores fetched...', jugador)));
    }

    render() {
        return (
            <div>
                <h2>Jugadores</h2>
                <ul>
                    {this.state.jugador.map(jugador =>
                        <li key={jugador.id}>{jugador.nombre}</li>
                    )}
                </ul>
            </div>
        );
    }
}

export default JugadoresPagina;
